import { useState } from "react";
import { TComputer } from "../../services/types/types";
import styles from './PlaygroundSquare.module.css';

interface SquareProps {
    id: number;
    position: { x: number; y: number };
    onDragStart: Function;
    onDragOver: Function;
    onDrop: Function;
    computer: TComputer | undefined;
}

const PlaygroundSquare: React.FC<SquareProps> = ({
    id,
    position,
    computer,
    onDragStart,
    onDragOver,
    onDrop,
}) => {
    const [gridPositionFrom, setGridPositionFrom] = useState<number>();
    const [gridPositionTo, setGridPositionTo] = useState<number>();

    const style = {
        left: `${position.x}px`,
        top: `${position.y}px`,
    };

    const handleClick = (e: any, id: number) => {
        console.log("handleClick", { e, id, computer })
    }

    return (
        <div
            className={`${styles.square} ${id === computer?.id && styles.squareOccupied}`}
            draggable
            onDragStart={(e) => onDragStart(e, id)}
            onDragOver={(e) => onDragOver(e)}
            onDrop={(e) => onDrop(e, id)}
            onClick={(e) => { handleClick(e, id) }}
        />
    );
};

export default PlaygroundSquare;
